        <section class="meet">
            <p class="meet_title">Meet The Team</p>
            <div class="meet_john">
                <img src="http://bootstrap-wp-theme-twomain/wp-content/uploads/2023/07/John-Cowan.png">
                <div class="meet_john_content">
                    <h2>John Cowan</h2>
                    <p class="meet_italic">Founder and President, Sunflower Energy</p>
                    <p class="meet_desc">John Cowan is Sunflower Energy’s president and has been involved in the energy, electricity, and natural gas industries for over 30 years. He has been the manager and owner of businesses that have supplied energy to over 200,000 customers.</p>
                </div>
            </div>
            <div class="meet_peter">
                <img class="img" src="http://bootstrap-wp-theme-twomain/wp-content/uploads/2023/07/Peter-Stabins.png">
                <div class="meet_john_content">
                    <h2>Peter Stabins</h2>
                    <p  class="title_italic">Program Designer and Senior Vice-President, Sunflower Energy</p>
                    <p class="title_tit">Peter Stabins is the program designer and senior vice-president at Sunflower Energy. He possesses engineering, M.B.A., and law degrees, is a lawyer at Stabins Energy Law, and owns and manages businesses that do research in clean energy. He is also the author of an energy trading book.</p>    
                </div>
            </div>
        </section>


